import React, { useState, useEffect } from 'react';

const Category_courses = (props) => {
  return (
    <div >
      {
        props.category.map((e, i) => {
          return <div key={i}>
            <div className='course'>{e.name}</div>
          </div>
        })
      }
    </div>
  );
};
export default Category_courses;
